const parseCurrency = (value: string): number => {
    if (typeof value !== 'string' || value.trim() === '' || value.trim() === '-') return 0;
    return parseFloat(value.replace(/\$ /g, '').replace(/\./g, '').replace(/,/g, '.'));
};

const parseEstado = (estado: string): EstadoFactura => {
    const estadoUpper = estado.trim().toUpperCase();
    if (Object.values(EstadoFactura).includes(estadoUpper as EstadoFactura)) {
        return estadoUpper as EstadoFactura;
    }
    if (estadoUpper === '' || estadoUpper === '#VALUE!') {
        return EstadoFactura.PENDIENTE;
    }
    return EstadoFactura.PENDIENTE;
};

const emptyData = {
    facturas: [],
    kpiData: { totalFacturado: 0, totalCobrado: 0, totalImpago: 0, cantidadFacturas: 0 },
    monthlySales: [],
    topClients: [],
    statusData: [],
    availableYears: [],
};


export const useDashboardData = (selectedYear: string) => {
    return useMemo(() => {
        try {
            const lines = rawData.trim().split('\n').slice(1);
            if (lines.length === 0) return emptyData;

            const allFacturas: Factura[] = lines.map(line => {
                const columns = line.split('\t');
                const estadoStr = columns[12] ? columns[12].trim() : '';
                let estado = parseEstado(estadoStr);
                
                if (columns[5] && columns[5].toLowerCase().includes('anulac')) {
                    estado = EstadoFactura.ANULADO;
                }

                return {
                    razonSocial: columns[0] || '',
                    empresa: columns[1] || '',
                    puntoVenta: parseInt(columns[2], 10) || 0,
                    fechaRegistro: new Date(columns[3]),
                    facturaN: columns[4] || '',
                    concepto: columns[5] || '',
                    cantidad: parseFloat(columns[6] ? columns[6].replace(',', '.') : '0') || 0,
                    precioUnitario: parseCurrency(columns[7]),
                    subtotal: parseCurrency(columns[8]),
                    alicuotaIva: parseCurrency(columns[9]),
                    subtotalConIva: parseCurrency(columns[10]),
                    estado: estado,
                    quincenaTexto: columns[14] || '',
                };
            }).filter(f => f.estado !== EstadoFactura.ANULADO);

            const availableYears = Array.from(new Set(allFacturas.map(f => f.fechaRegistro.getUTCFullYear().toString())))
                .sort((a, b) => parseInt(b) - parseInt(a));

            const facturas = selectedYear === 'all'
                ? allFacturas
                : allFacturas.filter(f => f.fechaRegistro.getUTCFullYear().toString() === selectedYear);

            // KPI Calculations
            const kpiData: KpiData = facturas.reduce((acc, curr) => {
                acc.totalFacturado += curr.subtotalConIva;
                if (curr.estado === EstadoFactura.COBRADO) {
                    acc.totalCobrado += curr.subtotalConIva;
                }
                if (curr.estado === EstadoFactura.IMPAGO) {
                    acc.totalImpago += curr.subtotalConIva;
                }
                return acc;
            }, { totalFacturado: 0, totalCobrado: 0, totalImpago: 0, cantidadFacturas: facturas.length });

            // Monthly Sales
            const salesByMonth: { [key: string]: number } = {};
            facturas.forEach(factura => {
                const month = factura.fechaRegistro.toLocaleString('es-ES', { month: 'short', year: '2-digit', timeZone: 'UTC' }).replace('.', '').replace(' de ', '-').toLocaleUpperCase();
                if (!salesByMonth[month]) {
                    salesByMonth[month] = 0;
                }
                salesByMonth[month] += factura.subtotalConIva;
            });
            
            const monthOrderMap: { [key: string]: number } = {
                "ENE": 1, "FEB": 2, "MAR": 3, "ABR": 4, "MAY": 5, "JUN": 6,
                "JUL": 7, "AGO": 8, "SEP": 9, "OCT": 10, "NOV": 11, "DIC": 12
            };
            
            const monthlySales: MonthlySales[] = Object.entries(salesByMonth)
                .map(([name, total]) => ({ name, total }))
                .sort((a, b) => {
                    const [monthAStr, yearAStr] = a.name.split('-');
                    const [monthBStr, yearBStr] = b.name.split('-');
                    const yearA = parseInt(yearAStr, 10);
                    const yearB = parseInt(yearBStr, 10);
                    const monthA = monthOrderMap[monthAStr.toUpperCase()];
                    const monthB = monthOrderMap[monthBStr.toUpperCase()];

                    if (yearA !== yearB) return yearA - yearB;
                    return monthA - monthB;
                });

            // Top Clients
            const clientValue: { [key: string]: number } = {};
            facturas.forEach(factura => {
                if (!clientValue[factura.empresa]) {
                    clientValue[factura.empresa] = 0;
                }
                clientValue[factura.empresa] += factura.subtotalConIva;
            });
            
            const topClients: ClientData[] = Object.entries(clientValue)
                .map(([name, value]) => ({ name, value }))
                .sort((a, b) => b.value - a.value)
                .slice(0, 10)
                .reverse(); // For recharts vertical bar chart bottom-up rendering

            // Status Data
            const statusCounts: { [key: string]: number } = {
                [EstadoFactura.COBRADO]: 0,
                [EstadoFactura.IMPAGO]: 0,
                [EstadoFactura.PENDIENTE]: 0,
            };
            facturas.forEach(factura => {
                if (statusCounts[factura.estado] !== undefined) {
                    statusCounts[factura.estado]++;
                }
            });
            const statusData: StatusData[] = Object.entries(statusCounts)
                .map(([name, value]) => ({ name, value }))
                .filter(item => item.value > 0);

            return { facturas, kpiData, monthlySales, topClients, statusData, availableYears };
        } catch (error) {
            console.error("Error processing dashboard data:", error);
            return emptyData;
        }
    }, [selectedYear]);
};